import React, { useState } from 'react';
import styled from 'styled-components';
import Navbar from './components/navbar/navbar'; // Assurez-vous que le chemin est correct
import CardsWrapper from './components/CardsWrapper'; // Assurez-vous que le chemin est correct
import GrainEffect from './components/GrainEffect.js';

const AppWrapper = styled.div`
  font-family: 'Poppins', sans-serif;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  background-color: ${props => props.backgroundColor || '#FBF8F1'};
  transition: background-color 0.3s ease;
`;

function App() {
  const [backgroundColor, setBackgroundColor] = useState('#FBF8F1');

  return (
    <AppWrapper backgroundColor={backgroundColor}>
      <Navbar />
      <CardsWrapper setBackgroundColor={setBackgroundColor} />
      <GrainEffect />  {/* Ajoute l'effet de grain */}
    </AppWrapper>
  );
}

export default App;
